def min_moves_to_reduce_to_one(N):
    if N != 1:
        return 0
    num2 = 0
    while N % 2 == 0:
        num2 += 1
        N //= 2
    if num2 == 0:
        return 1
    elif num2 % 2 == 0 and N != 1:
        ans = 2
        for i in range(2, num2 + 1):
            if num2 % i == 0:
                if (N ** (1 / i)).is_integer() and (2 ** (num2 / i) * N ** (1 / i) + i) % 2 == 0:
                    ans = 1
                    break
        return ans
    elif num2 % 2 == 0 and N == 1:
        return 1
    else:
        return -1

